import React from 'react';
import {Paper, Tab, Tabs, ListItem, ListItemText} from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import Hidden from '@material-ui/core/Hidden';
import Divider from '@material-ui/core/Divider';
import MenuIcon from '@material-ui/icons/Menu';

const drawerWidth = 240;

const styles = theme => ({
  root: {
    flexGrow: 1,
    height: 430,
    zIndex: 1,
    overflow: 'hidden',
    position: 'relative',
    display: 'flex',
    width: '100%',
  },
  appBar: {
    position: 'absolute',
    marginLeft: drawerWidth,
    [theme.breakpoints.up('md')]: {
      width: `calc(100% - ${drawerWidth}px)`,
    },
  },
  navIconHide: {
    [theme.breakpoints.up('md')]: {
      display: 'none',
    },
  },
  toolbar: theme.mixins.toolbar,
  drawerPaper: {
    width: drawerWidth,
    [theme.breakpoints.up('md')]: {
      position: 'relative',
    },
  },
  content: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.default,
    padding: theme.spacing.unit * 3,
  },
});
class NavBar extends React.Component {
    state = {
        value: 0,
        mobileOpen: false,
      };

      handleDrawerToggle = () => {
        this.setState(state => ({ mobileOpen: !state.mobileOpen }));
      };    

    handleChange = (event, value) => {
        event.preventDefault();
        this.setState({ value });
    }
    render() {
        const { classes, theme } = this.props;

        const drawer = (
          <div>
            <div className="toolbar" />
            <Divider />
            <List>
                <ListItem>
                    <ListItemText>
                        <Typography>
                            Item 1.1
                        </Typography>
                    </ListItemText>
                </ListItem>
                <ListItem>
                    <ListItemText>
                        <Typography>
                            Item 1.2
                        </Typography>
                    </ListItemText>
                </ListItem>
            </List>
            <Divider />
            <List>
            <ListItem>
                    <ListItemText>
                        <Typography>
                            Item 2.1
                        </Typography>
                    </ListItemText>
                </ListItem>
                <ListItem>
                    <ListItemText>
                        <Typography>
                            Item 2.2
                        </Typography>
                    </ListItemText>
                </ListItem>
            </List>
          </div>
        );

        return (
            <div className="root">
            <AppBar className="appBar">
              <Toolbar>
                <IconButton
                  color="inherit"
                  aria-label="Open drawer"
                  onClick={this.handleDrawerToggle}
                  className="navIconHide"
                >
                  <MenuIcon />
                </IconButton>
                <Typography variant="title" color="inherit" noWrap>
                  Responsive drawer
                </Typography>
              </Toolbar>
            </AppBar>
            <Hidden mdUp>
              <Drawer
                variant="temporary"
                open={this.state.mobileOpen}
                onClose={this.handleDrawerToggle}
                ModalProps={{
                  keepMounted: true, // Better open performance on mobile.
                }}>
                {drawer}
              </Drawer>
            </Hidden>
            <Hidden smDown implementation="css">
              <Drawer
                variant="permanent"
                open>
                {drawer}
              </Drawer>
            </Hidden>
            <main className="content">
              <div className="toolbar" />
              <Typography noWrap>{'You think water moves fast? You should see ice.'}</Typography>
            </main>
          </div>
            // <div>
            //     <Paper>
            //         <Tabs
            //             value={this.state.value}
            //             onChange={this.handleChange}
            //             indicateColor={"primary"}
            //             centered>
            //             <Tab label="Home" href="/"></Tab>
            //             <Tab label="Facility" href="/"></Tab>
            //             <Tab label="Coaching" href="/"></Tab>
            //             <Tab label="Contact" href="/"></Tab>
            //         </Tabs>
            //     </Paper>
            // </div>
        );
    }
}

export default NavBar
